import React from 'react';

const Form = () => {
	return (

	<div className="f4 sans-serif bg-light-gray dib br2 b--white-30 pa3 ma2 bw2">
		<h1>Get in Touch</h1>
		<p className="f5">Please fill out the quick form and we will be in touch with lightening speed.</p>
		<label input="email"></label>
			<input type="text"className="bw0 b--black-40 br2"></input>
	</div>

		)
}

export default Form;
